import React, { Component } from 'react';

export default class LoginComponent extends Component {
    render() {

        return (
          <React.Fragment>
                <div>
                  <form>
                    <input type="text" />
                    <input type="password" />
                    <button type="submit">Validar</button>
                  </form>
                </div>
          </React.Fragment>
        );
    }
}
